import './App.css';
import Todo from './components/Todo';
import Header from './components/Header'
import Footer from './components/Footer'
import 'style.css'

const App = ()=> {
  return (
    <div className="App">
     <Header />
     <Todo/>
     <Footer />
    </div>
  );
}

export default App;
